public class 找到字符串中所有的字母异位词 {
    public static void main(String[] args) {
       findAnagrams("",
               "");
    }

    public static List<Integer> findAnagrams(String s, String p) {
        int lengthP = p.length(), lengthS = s.length();
        HashMap<Character, Integer> movingWindow = new HashMap<>();
        HashMap<Character, Integer> needWindow = new HashMap<>();
        for (int i = 0; i < lengthP; i++) {
            char element = p.charAt(i);
            int elementCount = needWindow.getOrDefault(element, 0)+1;
            needWindow.put(element,elementCount);
        }
        int count = 0, goal = needWindow.size();
        int left = 0, right = 0;
        List<Integer> resList = new ArrayList<>();
        while (right < lengthS) {
            char element = s.charAt(right);
            if (needWindow.containsKey(element)) {
                int elementCount = movingWindow.getOrDefault(element, 0) + 1;
                movingWindow.put(element, elementCount);
                if (elementCount == needWindow.get(element)) {
                    count++;
                }
            }
            right++;
            // 收缩窗口
            while (count == goal) {
                if (right-left == lengthP) {
                    resList.add(left);
                }
                char leftElement = s.charAt(left);
                if (needWindow.containsKey(leftElement)) {
                    if (needWindow.get(leftElement).equals(movingWindow.get(leftElement))) {
                        count--;
                    }
                    movingWindow.put(leftElement,movingWindow.get(leftElement)-1);
                }
                left++;
            }
        }
        return resList;
    }
}
